import React, { useState } from 'react';
import ReactMapGL from 'react-map-gl';
import { Button } from '@material-ui/core';

import Collapsible from '../Collapsible';

const Map: React.FunctionComponent = () => {
  const [isCollapsed, toggleCollapse] = useState(false);
  const [viewportOptions, setViewport] = useState({});

  const handleToggleCollapse = () => {
    toggleCollapse(!isCollapsed)
  }

  return (
    <>
      <ReactMapGL
        mapStyle="mapbox://styles/mapbox/streets-v9"
        mapboxApiAccessToken="pk.eyJ1IjoicmFmYWVsbWVsb24iLCJhIjoiY2syOWNzNng2MDdqaDNjbWp2czZtcjl0ciJ9.8SuHDi6E9lRERaWVbULzDQ"
        onViewportChange={(viewport) => setViewport({viewport})}
        {...viewportOptions}
      />
      <Button variant="contained" color="primary" onClick={handleToggleCollapse}>
        Hello World
      </Button>
      <Collapsible title="title" isCollapsed={isCollapsed} />
    </>
  );
}


export default Map
